import React from 'react';
import TeamMemberCard from '../components/TeamMemberCard/TeamMemberCard';
import castingIcon from '../images/castingIcon.png';
import Navbar from '../components/NavigationBar/Navbar'
import Footer from '../components/Footer/Footer'
import ImageComponent from '../components/ImageComponent/ImageComponent'
import EquipTecnic from '../images/backgroundImage.jpg'

const Actors = () => {
  const teamMembers = [
    {
      name: "Olga Miralles",
      role: "Paper",
      bio: "Text breu",
      imageUrl: castingIcon,
    },
    {
      name: "Xavier Sagrera",
      role: "Paper",
      bio: "Text breu",
      imageUrl: castingIcon,
    },
    {
      name: "Clara Arxer Vargas",
      role: "Paper",
      bio: "Text breu",
      imageUrl: castingIcon,
    },
    {
      name: "Joan Maria Soler Reguera",
      role: "Paper",
      bio: "Text breu",
      imageUrl: castingIcon,
    },
    {
      name: "Adrià Cano Puigvert",
      role: "Paper",
      bio: "Text breu",
      imageUrl: castingIcon,
    },
    {
      name: "Cora Mir Sanchez",
      role: "Paper",
      bio: "Text breu",
      imageUrl: castingIcon,
    },
    {
      name: "Eva Casadevall Adroher",
      role: "Paper",
      bio: "Text breu",
      imageUrl: castingIcon,
    },
    {
      name: "Daniel Moreta",
      role: "Direcció musical",
      bio: "Text breu",
      imageUrl: castingIcon,
      twitterLink: "https://twitter.com",
      instagramLink: "https://www.instagram.com",
      facebookLink: "https://www.facebook.com",
      tiktokLink: "https://www.tiktok.com",
    },
    {
      name: "Isaac d'Aiguaviva",
      role: "Disseny d'escenografía",
      bio: "Text breu",
      imageUrl: castingIcon,
      twitterLink: "https://twitter.com",
      instagramLink: "https://www.instagram.com",
      facebookLink: "https://www.facebook.com",
      tiktokLink: "https://www.tiktok.com",
    },
    {
      name: "Pau Morales",
      role: "Dissenyador gràfic",
      bio: "Text breu",
      imageUrl: castingIcon,
      twitterLink: "https://twitter.com",
      instagramLink: "https://www.instagram.com",
      facebookLink: "https://www.facebook.com",
      tiktokLink: "https://www.tiktok.com",
    },
    {
      name: "Joan Cano",
      role: "Gestió de personal",
      bio: "Text breu",
      imageUrl: castingIcon,
    },
    {
      name: "Carme Parramon",
      role: "Dissenyador gràfic",
      bio: "Text breu",
      imageUrl: castingIcon,
      twitterLink: "https://twitter.com",
      instagramLink: "https://www.instagram.com",
      facebookLink: "https://www.facebook.com",
      tiktokLink: "https://www.tiktok.com",
    },
  ];

  return (
    <div>
      <Navbar />
      <ImageComponent src={EquipTecnic} alt="Actors I Actrius" text="Actors I Actrius" />
      <div className="team-grid">
      <div className="team-grid__cards">
        {teamMembers.map((teamMember, index) => (
          <TeamMemberCard
            key={index}
            name={teamMember.name}
            role={teamMember.role}
            bio={teamMember.bio}
            imageUrl={teamMember.imageUrl}
            twitterLink={teamMember.twitterLink}
            instagramLink={teamMember.instagramLink}
            facebookLink={teamMember.facebookLink}
            tiktokLink={teamMember.tiktokLink}
          />
        ))}
      </div>
    </div>
      <Footer />
    </div>

  );
};

export default Actors;
